import { FC } from "react";
import styled from "styled-components";

const MainDiv = styled.div`
width:100%;
height:100%;
margin-left:65px;
`;
const CorporateDiv = styled.div`
height:200px;
width: 890px;
background-color:red;
`;
const CorporateImage = styled.div`
`;


export const Workspace: FC = () => {
    return (
    <MainDiv>
        <CorporateDiv>
            <CorporateImage/>
        </CorporateDiv>
    </MainDiv>
    )
}
